in_source: |
  .data:
      sum: num 0 
      left_boarder: num 0
      right_boarder: num 1000
      div1: num 3
      div2: num 5
      zero: num 0
      one: num 1
      out_d: num 1
  .text:
      loop:
          load left_boarder ; загрузили текущее значение
          cmp right_boarder ; значение аккумулятора не изменилось, только флаги выставились
          jz exit
          cmp div1
          jn next_loop
          mod div1 ; В аккумуляторе остаток от деления
          cmp zero
          jnz next_div
          load sum
          add left_boarder
          store sum
          jmp next_loop
      next_div:
          load left_boarder
          cmp div2
          jn next_loop
          mod div2
          cmp zero
          jnz next_loop
          load sum
          add left_boarder
          store sum
      next_loop:
          load left_boarder
          add one
          store left_boarder
          jmp loop
      exit:
          load sum
          store [out_d]
          hlt
